import React from "react";
import styled from "styled-components";
import MenuIcon from "@mui/icons-material/Menu";

const Header = () => {
    return (
        <Container>
            <Logo>
                <img src="./images/logo.svg" alt="" />
            </Logo>
            <Nav>
                <a href="#">Model S</a>

                <a href="#">Model X</a>

                <a href="#">Model 3</a>

                <a href="#">Model Y</a>

                <a href="#">Solar Panels</a>

                <a href="#">Solar Roof</a>
            </Nav>
            <ShopTesla>
                <a href="#">Shop</a>
                <a href="#">Tesla Account</a>
                <CustomMenu></CustomMenu>
            </ShopTesla>
        </Container>
    );
};

export default Header;

const Container = styled.div`
    min-height: 60px;
    position: fixed;
    display: flex;
    align-items: center;
    padding: 0 20px;
    top: 0;
    left: 0;
    right: 0;
`;

const Logo = styled.div``;

const Nav = styled.div`
    display: flex;
    align-items: center;
    flex: 1;
    justify-content: center;

    a {
        font-weight: 600px;
        text-transform: uppercase;
        padding: 0 10px;
        flex-wrap: nowrap;
    }

    @media (max-width: 768px) {
        display: none;
    }
`;

const ShopTesla = styled.div`
    display: flex;
    align-items: center;
    a {
        font-weight: 600px;
        text-transform: uppercase;
        margin-right: 10px;
        flex-wrap: nowrap;
    }
`;

const CustomMenu = styled(MenuIcon)`
    cursor: pointer;
`;
